function readMore(){let e=document.getElementById("dots"),t=document.getElementById("more"),n=document.getElementById("seeMoreBtn");"none"===e.style.display?(e.style.display="inline",n.innerHTML="See more",t.style.display="none"):(e.style.display="none",n.innerHTML="See less",t.style.display="inline")}function showPassword(){let e=document.getElementById("password");"password"===e.type?e.type="text":e.type="password"}$(".js-input").keyup(function(){$(this).val()?$(this).addClass("not-empty"):$(this).removeClass("not-empty")});